import React, { useState } from 'react'
import {
    Box
} from '@mui/material';

import { useAppDispatch, useAppSelector } from '../../app/hooks';
import SearchBar from './SearchBar';
import { fetchProducts } from './homeSlice';

const Home = () => {

    const products = Object.values(useAppSelector(state => state.home.entities));
    const [search, setSearch] = useState<string>('');
    const dispatch = useAppDispatch();

    console.log(products, 'products');

    const onSearch = () => {
        dispatch(fetchProducts({ product: search }))
    }

    return (
        <Box >
            <SearchBar search={search} setSearch={setSearch} onSearch={onSearch} />
        </Box>
    )
}

export default Home;
